import React from "react";
import "./LeftBar.scss";

const LeftBar = () => {
  return (
    <div className="leftBar">
      <div className="container">
        <div className="menu">
          <div className="user">
            <img
              src="https://images.pexels.com/photos/1215831/pexels-photo-1215831.jpeg?auto=compress&cs=tinysrgb&w=600"
              alt="User Pic"
            />
            <span>Anee Patil</span>
          </div>
          
        </div>
      </div>
    </div>
  );
};

export default LeftBar;
